import Auth from "../components/auth-interface";
import Input from "../components/form-input";

const Login = () => (
    <div>
      <Auth>
        <Input />
        <Input type={props.type} placeholder={props.placeholder} />
      </Auth>
      
    </div>
  );

export default Login;
